import React, { useState } from "react";
import "./Navbar.css";
import gymIcon from "./assets/gym-icon-.png"; // Replace with your actual icon path

const Navbar = () => {
  const [dropdown, setDropdown] = useState(false);

  // Function to toggle dropdown menu
  const toggleDropdown = () => {
    setDropdown(!dropdown);
  };

  return (
    <nav className="navbar">
      <div className="logo">
        <img src={gymIcon} alt="GymFluencer Logo" className="logo-icon" />
        <span className="logo-text" style={{ color: "red" }}>GymFluencer</span>
      </div>
      <ul className="nav-links">
        <li><a href="#home">Home</a></li>
        <li><a href="#about">About</a></li>
        <li className="dropdown">
          <a href="#our-services" onClick={toggleDropdown}>Our Services</a>
          {dropdown && (
            <ul className="dropdown-menu">
              <li><a href="#gym-list">Gym List</a></li>
              <li><a href="#benefits">Benefits</a></li>
            </ul>
          )}
        </li>
        <li><a href="#blogs">Blogs</a></li>
        <li><a href="#contact">Contact</a></li>
        <li><a href="#join-us-now" className="join-btn">Join Us Now</a></li>
      </ul>
    </nav>
  );
};

export default Navbar;
